import {FooterBoxStyled,
    NavMenu,
    NavMenuLi,
    NavMenuElement
} from "./Footer.styled"
import {Logo} from "../Header/Logo/Logo"

export const Footer = () => {
    return (
    <FooterBoxStyled>
        <Logo/>
        <NavMenu>
            <NavMenuLi><NavMenuElement>HOME</NavMenuElement></NavMenuLi>
            <NavMenuLi><NavMenuElement>ABOUT US</NavMenuElement></NavMenuLi>
            <NavMenuLi><NavMenuElement>HOME</NavMenuElement></NavMenuLi>
        </NavMenu>
        <ul>
            <li></li>
            <li></li>
            <li></li>
        </ul>
    </FooterBoxStyled>
    );
  };
